const styles = theme => ({
    root: {
        display: 'flex',
        marginBottom: theme.spacing(2),
        padding: theme.spacing(1),
        maxWidth: theme.spacing(105),
        width: "80vw",
    },
    content: {
        flexGrow: 1,
    },
    details: {
        display: 'flex',
        flexDirection: 'row',
        marginTop: theme.spacing(1),
    },
    detailsItem: {
        margin: theme.spacing(0, 2, 0, 0),
    },
    actions: {
        display: 'flex',
        flexDirection: 'row',
    }
});

export default styles;
